import React from 'react'
import { Grid } from '@material-ui/core'
import OurTeam from './ourTeam';
import OurTeamFake from './ourTeamFake';
import OneCard from './oneCard';



export default function OurTeamCards() {
  const [inforTeam,setInforTeam]= React.useState(OurTeamFake);
  const changeInfor = ()=>{
    setInforTeam(OurTeamFake);
  }
  return (
    <div>
    <Grid container spacing={3}>            
      {inforTeam.map((infor) => (<Grid item sm={3} xs={6}><OneCard onClick={changeInfor} key={infor.name} infor={infor}/></Grid>))}
    </Grid>
    </div>
  )
}
